var cChartElement_map	= function(){};
cChartElement_map.prototype	= new cChartElement;

cChartElement_map.handlers	= {
	'DOMNodeInsertedIntoDocument':	function() {
		this.refresh();
	}
};

cChartElement_map.prototype.refresh	= function() {
	// Collect and pre-analyze data
	var aData	= [],
		nGroupMax	=-Infinity,
		nGroupMin	= Infinity;
	for (var nGroup = 0, nGroups = this.childNodes.length, oGroup, aGroup; oGroup = this.childNodes[nGroup]; nGroup++) {
		aGroup	= [];
		for (var nItem = 0, nItems = oGroup.childNodes.length, oItem, aValue, nValue; oItem = oGroup.childNodes[nItem]; nItem++) {
			aValue	= oItem.getAttribute("value").split(',');
			nValue	= aValue[1] * 1;
			if (nValue > nGroupMax)
				nGroupMax	= nValue;
			if (nValue < nGroupMin)
				nGroupMin	= nValue;
			aGroup.push(aValue);
		}
		aData.push(aGroup);
	}

	for (var nGroup = 0, nGroups = aData.length, oGroup; nGroup < nGroups; nGroup++) {
		// Get DOM element
		oGroup = this.childNodes[nGroup];

		for (var nItem = 0, nItems = aData[nGroup].length, oItem; nItem < nItems; nItem++) {
			// Get DOM element
			oItem = oGroup.childNodes[nItem];
			//
			oItem.$getContainer("value").setAttribute("d", cChartElement_map.countries[aData[nGroup][nItem][0]][1]);
			oItem.$getContainer("value").setAttribute("fill-opacity", 0.2 + 0.8 * aData[nGroup][nItem][1] / nGroupMax);
		}

		// Draw legend
		var nXPath	= 20,
			nYPath	=(200 + nGroup * 20);
		oGroup.$getContainer("path").setAttribute("d", "M" + (nXPath - 5) + "," + (nYPath - 5) + "h10 v10 h-10 v-10 z");
		oGroup.$getContainer("label").setAttribute("x", nXPath + 20);
		oGroup.$getContainer("label").setAttribute("y", nYPath + 5);
	}
};

cChartElement_map.prototype._onMouseOver	= function(oEvent) {
	if (oEvent.target.parentNode == this.$getContainer("underlay"))
		oEvent.target.setAttribute("class", oEvent.target.getAttribute("class").replace(/(c-mapItem--underlay_hover)?$/, " c-mapItem--underlay_hover"));
};

cChartElement_map.prototype._onMouseOut	= function(oEvent) {
	if (oEvent.target.parentNode == this.$getContainer("underlay"))
		oEvent.target.setAttribute("class", oEvent.target.getAttribute("class").replace(/ c-mapItem--underlay_hover/, ""));
};

